// RegisterForm.jsx
import React, { useState } from 'react';
import { FaArrowLeft } from 'react-icons/fa';
import { useNavigate } from 'react-router-dom';

const RegisterForm = () => {
  const [formData, setFormData] = useState({
    fullName: '',
    email: '',
    password: '',
    confirmPassword: '',
    course: '',
    year: '',
    role: '',
    studentIdFile: null,
    studyLoadFile: null,
  });

  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleRoleChange = (role) => {
    setFormData((prev) => ({
      ...prev,
      role,
    }));
  };

  const handleFileChange = (e) => {
    const { name, files } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: files[0],
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // TODO: Implement registration logic (API call)
    // You can use formData here
  };

  return (
    <div className="min-h-screen flex justify-center items-start bg-gray-100 px-4 py-6">
      <div className="bg-white p-6 rounded-xl shadow-md w-full max-w-sm space-y-4">
        {/* Back Button */}
        <div className="flex items-center space-x-2">
          <FaArrowLeft className="text-gray-600" />
          <h2 className="text-xl font-semibold">Create Account</h2>
        </div>

        <form className="space-y-4" onSubmit={handleSubmit}>
          {/* Full Name */}
          <input
            type="text"
            name="fullName"
            value={formData.fullName}
            onChange={handleChange}
            placeholder="Enter your full name"
            className="w-full border rounded-md px-4 py-2 text-sm"
          />

          {/* Email Address */}
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            placeholder="your.email@school.edu"
            className="w-full border rounded-md px-4 py-2 text-sm"
          />

          {/* Password */}
          <input
            type="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
            placeholder="Create a strong password"
            className="w-full border rounded-md px-4 py-2 text-sm"
          />

          {/* Confirm Password */}
          <input
            type="password"
            name="confirmPassword"
            value={formData.confirmPassword}
            onChange={handleChange}
            placeholder="Confirm your password"
            className="w-full border rounded-md px-4 py-2 text-sm"
          />

          {/* Course and Year */}
          <div className="flex gap-2">
            <input
              type="text"
              name="course"
              value={formData.course}
              onChange={handleChange}
              placeholder="Course"
              className="w-1/2 border rounded-md px-4 py-2 text-sm"
            />
            <input
              type="text"
              name="year"
              value={formData.year}
              onChange={handleChange}
              placeholder="Year"
              className="w-1/2 border rounded-md px-4 py-2 text-sm"
            />
          </div>

          {/* School ID Upload */}
          <div className="border border-dashed rounded-md p-4 text-center space-y-2">
            <p className="text-sm text-gray-500">Upload your student ID</p>
            <input
              type="file"
              name="studentIdFile"
              accept="image/*,.pdf"
              onChange={handleFileChange}
              className="block mx-auto"
            />
          </div>

          {/* Study Load Upload */}
          <div className="border border-dashed rounded-md p-4 text-center space-y-2">
            <p className="text-sm text-gray-500">Upload your study load</p>
            <input
              type="file"
              name="studyLoadFile"
              accept="image/*,.pdf"
              onChange={handleFileChange}
              className="block mx-auto"
            />
          </div>

          {/* Role Selection */}
          <div className="space-y-2">
            <p className="text-sm font-medium">Select Your Role</p>
            {['Learner', 'Tutor', 'Both'].map((option) => (
              <label
                key={option}
                className={`flex items-center border rounded-md px-4 py-2 cursor-pointer ${
                  formData.role === option ? 'border-blue-600' : 'border-gray-300'
                }`}
              >
                <input
                  type="radio"
                  name="role"
                  value={option}
                  checked={formData.role === option}
                  onChange={() => handleRoleChange(option)}
                  className="mr-2"
                />
                {option === 'Learner' && 'I want to request skill-based help'}
                {option === 'Tutor' && 'I want to offer my skill-based skills'}
                {option === 'Both' && 'I can do both – offer and need help too'}
              </label>
            ))}
          </div>

          {/* Create Account */}
          <button
            type="submit"
            className="w-full bg-black text-white py-2 rounded-md font-medium"
          >
            Create Account
          </button>
        </form>

        {/* Sign In Link */}
        <p className="text-center text-sm text-gray-500">
          Already have an account?{' '}
          <span
            className="text-black font-semibold cursor-pointer hover:underline"
            onClick={() => navigate('/')}
          >
            Sign In
          </span>
        </p>
      </div>
    </div>
  );
};

export default RegisterForm;
